import React from "react";
import { Box, Typography } from "@mui/material";

const LandingPage: React.FC = () => {
    return (
        <Box
            sx={{
                height: "100vh",
                width: "100%",
                backgroundColor: "#FFEEEE", // Light beige background
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                padding: "2rem",
                gap: "8rem", // Adjust spacing between sections
            }}
        >
            {/* IVA and PARK Section */}
            <Box
                sx={{
                    display: "flex",
                    justifyContent: "center",
                    alignItems: "center",
                    gap: "2rem", // Space between IVA and PARK
                }}
            >
                {/* IVA Column */}
                <Typography
                    variant="h1"
                    sx={{
                        color: "#4A2040", // Dark purple
                        lineHeight: 1,
                        fontWeight: "bold",
                        textAlign: "center",
                    }}
                >
                    I<br />V<br />A
                </Typography>

                {/* PARK Column */}
                <Typography
                    variant="h1"
                    sx={{
                        color: "#4A2040", // Dark purple
                        lineHeight: 1,
                        fontWeight: "bold",
                        textAlign: "center",
                    }}
                >
                    P<br />A<br />R<br />K
                </Typography>
            </Box>

            {/* Introduction Section */}
            <Box sx={{ maxWidth: "40%", textAlign: "left" }}>
                <Typography
                    variant="h5"
                    sx={{
                        color: "#000", // Black color
                        fontWeight: "bold",
                        marginBottom: "1rem",
                    }}
                >
                    Hello there,
                </Typography>
                <Typography
                    sx={{
                        color: "#000",
                        fontSize: "1.2rem",
                        lineHeight: 1.6,
                    }}
                >
                    I am a UI/UX designer passionate about turning complex ideas
                    into intuitive, engaging experiences. I combine design and
                    technology to create solutions that meaningfully connect
                    with users.
                </Typography>
            </Box>
        </Box>
    );
};

export default LandingPage;
